import React from "react";
import { useState } from 'react';

function Results(props:any) {

    var showInfo = props.data.map((element:any) => {
        return (
            <li key={element.show.id} className ="show">
                <div className = "showBox">
                    <a href={element.show.url} className="showLink">{element.show.name}</a>
                </div>
                <div>
                    {element.show.image ? (<img src={element.show.image.medium} alt={element.show.name} />
                    ) : (<div className="missing-img-div"><img src=""/><h1>no photo available</h1></div>)}
                </div>
                <div>
                    <a href={element.show.url} className="showGenre" > {element.show.genre} </a>
                </div>
            </li>
        )
    });

    return (
        <ul className = "showBox">
            {showInfo}
            </ul>        
    );
};

export default Results;
